The fields in the Block header relevant to the consensus process are: struct BlockHeader { ... prev_hash: BlockHash, height: BlockHeight, epoch_id: EpochId, last_final_block_hash: BlockHash, approvals: Vec<Option<Signature>> ...
} Block producers in the particular epoch exchange many kinds of messages. The two kinds that are relevant to the consensus are Blocks and Approvals . The approval contains the following fields: enum ApprovalInner { Endorsement(BlockHash), Skip(BlockHeight),
} struct Approval { inner: ApprovalInner, target_height: BlockHeight, signature: Signature, account_id: AccountId
} Where the parameter of the Endorsement is the hash of the approved block, the parameter of the Skip is the height of the approved block, target_height is the specific height at which the approval can be used (an approval with a particular target_height can be only included in the approvals of a block that has height = target_height), account_id is the account of the block producer who created the approval, and signature is their signature on the tuple (inner, target_height).

